angular.module('templates').run(['$templateCache', function($templateCache) {$templateCache.put('ui/builds/build-summary.html','<h3 class="text-left"><dnsim-job-icon item="::buildCtrl.build.job"></dnsim-job-icon>{{::buildCtrl.buildName}} <small><span ng-show="::buildCtrl.build.playerLevel > 0">lv{{::buildCtrl.build.playerLevel}}&nbsp;</span> <span ng-show="::buildCtrl.build.job && buildCtrl.build.job.id > 0">{{::buildCtrl.build.job.name}}&nbsp;</span> <span ng-show="::buildCtrl.build.enemyLevel > 0">{{\'vs\' | translate}}&nbsp;lv{{::buildCtrl.build.enemyLevel}}&nbsp;</span><br><span ng-if="buildCtrl.getSaveDate()">{{::buildCtrl.getSaveDate()}} {{::buildCtrl.getSaveTime()}}<span class="hidden-xs"> |&nbsp;</span><br class="visible-xs"></span><span dnsim-stats build="::buildCtrl.build" stats="::buildCtrl.stats.calculatedStats" separator="\'|\'" filter="\'summaryDisplay\'"></span><br></small></h3>');}]);